interface SvgProps {
    className?: string;
    strokeColor?: string;
    strokeWidth?: number;
    fillColor?: string;
    width?: number;
    height?: number;
    name: string;
    leftFillColor?: string;
    rightFillColor?: string;
}

export default function Icon({
    className,
    name,
    strokeColor = 'var(--black)',
    strokeWidth = 1.75,
    fillColor = 'none',
    width,
    height,
    leftFillColor,
    rightFillColor,
}: SvgProps) {
    const icon = icons[name] || icons.default;
    return icon({
        className,
        strokeColor,
        strokeWidth,
        fillColor,
        width,
        height,
        name,
        leftFillColor,
        rightFillColor,
    });
}
